import React  from "react";
import { Link } from "react-router-dom";

function Header() {
    return (
      <h1>
        Header
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/contact">Contact</Link>
      </h1>
    );
}
export default Header;
